import React from "react"
export default function Header() {
    return (
        <header>
            <div className="App-heading-banner">
                <h1 className="App-heading">Ramsey's Crochet Corner</h1>
                <p>Home for all your cold weather needs!</p>
            </div>
        </header>
    )
}
